import React from 'react';

import { Route } from "react-router-dom";

function Name (){


    return <h1>hello root</h1>

};


function Movie (){


    return <h1>hello Movie</h1>

};

function App() {

    return <>
            
            
            <Route path="/" exact component={Name} />
            <Route path="/movie" exact component={Movie} />
          
       
    </>;
    
}
export default App;
